INSERT INTO `zhenghe_doctor` VALUES ('1119c0b8da43453c9a71f95d9200b966', 'e40e4e75f6b14dd187ab9a98c6e49597', '王永学', '1', '501', '/zhenghe/userfiles/1/files/zhenghe/zhengheDoctor/2016/01/4487174_104042823000_2.jpg', '近5年发表论文近50篇，其中SCI论文10篇、影响因子30余分，专利3项，主持国家自然科学基金青年基金一项，军队、医院课题多项', '脊柱外科，微创手术，生物材料，脊柱肿瘤', '5090c2293205468c99b4bd91fa642e4e', '13800138000', 'e10adc3949ba59abbe56e057f20f883e', '1', '1', '2016-01-07 00:20:55', '1', '/zhenghe/zhengheImage/userAvatar/1119c0b8da43453c9a71f95d9200b966.png', '5', null, null, '测试医生账号', '2016-01-07 00:20:55', null, null);
INSERT INTO `zhenghe_doctor` VALUES ('223cb33530384f8bb510ff0700791a5d', 'e40e4e75f6b14dd187ab9a98c6e49597', '卢泽彬', '1', '502', '/zhenghe/zhengheImage/userAvatar/3ea4ef873a59233cab37700231255575.png', '近5年发表论文近50篇，其中SCI论文10篇、影响因子30余分，专利3项，主持国家自然科学基金青年基金一项，军队、医院课题多项迷宫', '脊柱外科你你会哄你', '5090c2293205468c99b4bd91fa642e4e', '13800138111', 'e10adc3949ba59abbe56e057f20f883e', '1', '8', '2016-01-14 19:33:36', '1', null, '5', null, null, '', '2016-01-14 19:33:36', null, null);
