INSERT INTO `zhenghe_doctor` VALUES ('6d17479dad7145bc8b3bf550798b1a24', 'e40e4e75f6b14dd187ab9a98c6e49597', '陈舟', '1', '501', '/zhenghe/userfiles/1/files/zhenghe/zhengheDoctor/2016/01/4487174_114025467000_2.jpg', '毕业于中山大学附属第一医院临床医学专业，医学学士学位，发表国际级文章八篇，均为手法治疗研究。', '擅长中风病人的康复治疗，尤擅通过手法治疗脊柱及骨关节疾病的治疗及研究。对颈椎病、腰间盘突出症等有着丰富的康复经验。', '5090c2293205468c99b4bd91fa642e4e', '13800138100', 'e10adc3949ba59abbe56e057f20f883e', '1', '3', '2016-01-07 00:52:46', '2', '/zhenghe/zhengheImage/userAvatar/6d17479dad7145bc8b3bf550798b1a24.png', '5', null, null, '专家会诊测试专家', '2016-01-07 00:52:46', null, null);
INSERT INTO `zhenghe_doctor` VALUES ('7449ad39f0944a4390e3e003582f11bc', 'd173beec8e3648509ac252b3d05e4f14', '陈慧', '2', '501', '/zhenghe/userfiles/1/files/zhenghe/zhengheDoctor/2016/01/4487174_120311434000_2.jpg', '对脑外伤，颅脑损伤及颅内出血患者有丰富经验。现就认于第一医院骨科，擅长对各类型骨折及骨肿瘤的治疗。ghhhff', '以各种关节关节镜的诊断，治疗，交叉韧带重建，肩袖修补，肩周炎松解，骨性关节炎，半月板损伤，关节内游离体等，原发骨肿瘤，创伤骨折，关节脱位，手外伤等骨科疾病。', '3cd2e61473f5446fbe694e85560e5384', '13800138003', 'e10adc3949ba59abbe56e057f20f883e', '1', '4', '2016-01-07 00:56:46', '1', '/zhenghe/zhengheImage/userAvatar/7449ad39f0944a4390e3e003582f11bc.png', '5', null, null, '', '2016-01-07 00:56:46', null, null);
INSERT INTO `zhenghe_doctor` VALUES ('95e1df161e9c4339beaf3fd66b3ecf38', 'c527446915a0415b8afd92b3c5cfb470', '黄贤', '1', '502', '/zhenghe/userfiles/1/files/zhenghe/zhengheDoctor/2016/01/4487174_114022773000_2.jpg', '主治～颈椎病，腰椎间盘突出，腰椎扭伤，踝关节骨折，尺桡骨骨折，外科颈骨折，指骨骨折，趾骨骨折，胫腓骨骨折，膝关节滑膜炎等都可以保守治疗效果满意，不需手术治疗。', '四肢骨折、腰椎骨折、颈腰间盘突等骨科疾患的诊疗。', '5090c2293205468c99b4bd91fa642e4e', '13800138101', 'e10adc3949ba59abbe56e057f20f883e', '1', '2', '2016-01-07 01:10:12', '2', '/zhenghe/zhengheImage/userAvatar/95e1df161e9c4339beaf3fd66b3ecf38.png', '5', null, null, '', '2016-01-07 01:10:12', null, null);
