INSERT INTO `zhenghe_product` VALUES ('09b2bb1fa3e546bca1d37b8f8b5d2e61', 'f4a3e548762a442586a7f1e30a393ebb', '复方金刚烷胺氨基比林片', '0.01', 'otc', '盐酸金刚烷胺0.1g，氨基比林0.15g，马来酸氯苯那敏0.002g', '6片&times;1板/盒', '用于感冒引起的发烧、头痛、鼻塞、打喷嚏、流鼻涕、肢体酸痛等。对其他原因引起的高热也有良好的作用。', '&lt;h1 style=&quot;margin-left: 40px;&quot;&gt;\r\n	同仁堂板蓝根颗粒说明书&lt;/h1&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:11px;&quot;&gt;请仔细阅读说明书并按说明书使用或在医师指导下购买和使用&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;【药品名称】通用名称：板蓝根颗粒&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	英文名称：Banlangen Keli&lt;/p&gt;\r\n&lt;p&gt;\r\n	商品名称：板蓝根颗粒&lt;/p&gt;\r\n&lt;p&gt;\r\n	【成份】板蓝根。辅料为蔗糖、糊精。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【功能主治】清热解毒。用于病毒性感冒，咽喉肿痛。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【用法用量】开水冲服，一次1-2袋，一日3-4次。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【注意事项】1.忌烟酒、辛辣、鱼腥食物。&lt;/p&gt;\r\n&lt;p&gt;\r\n	2.不宜在服药期间同时服用滋补性中药。&lt;/p&gt;\r\n&lt;p&gt;\r\n	3.糖尿病患者及有高血压、心脏病、肝病、肾病等慢性病严重者应在医师指导下服用。&lt;/p&gt;\r\n&lt;p&gt;\r\n	4.儿童、孕妇、哺乳期妇女、年老体弱、脾虚便溏者应在医师指导下服用。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【生产企业】北京同仁堂科技发展股份有限公司制药厂&lt;/p&gt;', '1', '11', '1', null, null, null, null, '', '2015-11-16 17:35:46', null, null);
INSERT INTO `zhenghe_product` VALUES ('45e3471ea03f4507bb2f6356fce188fe', '368547bf826c46f287f272336b43a709', '杏苏止咳糖浆', '0.01', 'otc', '120毫升／瓶', '瓶', '宣肺气，散风寒，镇咳祛痰。用于感冒风寒，咳嗽气逆。', '&lt;h1 style=&quot;margin-left: 40px;&quot;&gt;\r\n	同仁堂板蓝根颗粒说明书&lt;/h1&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:11px;&quot;&gt;请仔细阅读说明书并按说明书使用或在医师指导下购买和使用&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;【药品名称】通用名称：板蓝根颗粒&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	英文名称：Banlangen Keli&lt;/p&gt;\r\n&lt;p&gt;\r\n	商品名称：板蓝根颗粒&lt;/p&gt;\r\n&lt;p&gt;\r\n	【成份】板蓝根。辅料为蔗糖、糊精。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【功能主治】清热解毒。用于病毒性感冒，咽喉肿痛。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【用法用量】开水冲服，一次1-2袋，一日3-4次。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【注意事项】1.忌烟酒、辛辣、鱼腥食物。&lt;/p&gt;\r\n&lt;p&gt;\r\n	2.不宜在服药期间同时服用滋补性中药。&lt;/p&gt;\r\n&lt;p&gt;\r\n	3.糖尿病患者及有高血压、心脏病、肝病、肾病等慢性病严重者应在医师指导下服用。&lt;/p&gt;\r\n&lt;p&gt;\r\n	4.儿童、孕妇、哺乳期妇女、年老体弱、脾虚便溏者应在医师指导下服用。&lt;/p&gt;\r\n&lt;p&gt;\r\n	【生产企业】北京同仁堂科技发展股份有限公司制药厂&lt;/p&gt;', '6', '5', '0', null, null, null, null, '', null, null, null);
